import { useHistory } from "react-router-dom";
import { logout } from "../utils/";

function LogOut(props) {
  const [loggedIn, setLoggedIn] = useState(localStorage.getItem("token"));
  logout();
  setLoggedIn("");
  const history = useHistory();
  history.push("/");
  return null;
}

export default LogOut;
